VALUES
  ('3a7b9e92-06ea-4a6c-9d94-8ac0a780bd84', 'ورشة عمل حول فرص الاستثمار في السودان', 'Workshop on Investment Opportunities in Sudan', 'ورشة تفاعلية للتعريف بالفرص الاستثمارية المتاحة في مختلف القطاعات السودانية. تشمل الورشة عروضاً تقديمية من خبراء اقتصاديين، دراسات حالة ناجحة، وجلسات نقاش مفتوحة للإجابة على استفسارات المستثمرين المحتملين.', 'Interactive workshop introducing available investment opportunities in various Sudanese sectors. The workshop includes presentations by economic experts, successful case studies, and open discussion sessions to answer potential investors'' inquiries.', 'ورشة تفاعلية للتعريف بالفرص الاستثمارية المتاحة في مختلف القطاعات السودانية', 'Interactive workshop introducing available investment opportunities in various Sudanese sectors', '2025-01-16', '10:00:00', NULL, NULL, 'قاعة المؤتمرات - القنصلية', 'Conference Hall - Consulate', NULL, NULL, 'today', 'https://images.pexels.com/photos/3184465/pexels-photo-3184465.jpeg?auto=compress&cs=tinysrgb&w=600', '[]'::jsonb, 'القنصلية السودانية', 'Sudanese Consulate', 100, 0, true, NULL, NULL, '[]'::jsonb, true, true, 0, '2025-12-11T18:55:39.699117+00:00', '2025-12-11T18:55:39.699117+00:00', NULL, NULL),
  ('65d65063-28f9-4d5b-bf97-2f8293bd8506', 'لقاء مفتوح مع الجالية السودانية', 'Open Meeting with Sudanese Community', 'لقاء مفتوح لمناقشة احتياجات الجالية والإجابة على الاستفسارات. سيكون القنصل العام والموظفون المختصون متواجدين للاستماع إلى ملاحظات واقتراحات أفراد الجالية ومناقشة الخدمات المقدمة وكيفية تحسينها.', 'Open meeting to discuss community needs and answer inquiries. The Consul General and specialized staff will be present to listen to community members'' comments and suggestions and discuss services provided and how to improve them.', 'لقاء مفتوح لمناقشة احتياجات الجالية والإجابة على الاستفسارات', 'Open meeting to discuss community needs and answer inquiries', '2025-01-16', '19:00:00', NULL, NULL, 'القاعة الكبرى - القنصلية', 'Main Hall - Consulate', NULL, NULL, 'today', 'https://images.pexels.com/photos/1181406/pexels-photo-1181406.jpeg?auto=compress&cs=tinysrgb&w=600', '[]'::jsonb, 'القنصلية السودانية', 'Sudanese Consulate', 150, 0, false, NULL, NULL, '[]'::jsonb, false, true, 0, '2025-12-11T18:55:39.699117+00:00', '2025-12-11T18:55:39.699117+00:00', NULL, NULL),
  ('14312a6a-668d-4add-8793-de6fbea682c6', 'دورة تدريبية للطلاب السودانيين', 'Training Course for Sudanese Students', 'دورة تدريبية متخصصة للطلاب السودانيين حول الفرص التعليمية والمنح الدراسية. تتضمن الدورة معلومات عن المنح المتاحة، كيفية التقديم، متطلبات القبول، ونصائح لتحقيق التفوق الأكاديمي. كما سيتم استضافة طلاب متفوقين لمشاركة تجاربهم.', 'Specialized training course for Sudanese students on educational opportunities and scholarships. The course includes information about available scholarships, how to apply, admission requirements, and tips for achieving academic excellence. Outstanding students will also be hosted to share their experiences.', 'دورة تدريبية متخصصة للطلاب السودانيين حول الفرص التعليمية والمنح الدراسية', 'Specialized training course for Sudanese students on educational opportunities and scholarships', '2025-01-16', '14:00:00', NULL, NULL, 'القاعة التدريبية - القنصلية', 'Training Hall - Consulate', NULL, NULL, 'today', 'https://images.pexels.com/photos/1181675/pexels-photo-1181675.jpeg?auto=compress&cs=tinysrgb&w=600', '[]'::jsonb, 'وزارة التعليم العالي', 'Ministry of Higher Education', 80, 0, true, NULL, NULL, '[]'::jsonb, true, true, 0, '2025-12-11T18:55:39.699117+00:00', '2025-12-11T18:55:39.699117+00:00', NULL, NULL),
  ('1a603fe8-e41d-40bf-8a94-e3a56b8802c8', 'احتفالية اليوم الوطني السوداني', 'Sudanese National Day Celebration', 'احتفالية خاصة بمناسبة اليوم الوطني مع فعاليات ثقافية وتراثية. يتضمن الحفل عروضاً فنية، معارض تراثية، مأكولات سودانية تقليدية، وفقرات ترفيهية للأطفال. كما سيتم تكريم الشخصيات السودانية البارزة.', 'Special celebration for National Day with cultural and heritage activities. The celebration includes artistic performances, heritage exhibitions, traditional Sudanese cuisine, and entertainment segments for children. Outstanding Sudanese personalities will also be honored.', 'احتفالية خاصة بمناسبة اليوم الوطني مع فعاليات ثقافية وتراثية', 'Special celebration for National Day with cultural and heritage activities', '2025-01-17', '18:00:00', NULL, NULL, 'مركز الملك عبدالعزيز الثقافي', 'King Abdulaziz Cultural Center', NULL, NULL, 'tomorrow', 'https://images.pexels.com/photos/1181263/pexels-photo-1181263.jpeg?auto=compress&cs=tinysrgb&w=600', '[]'::jsonb, 'القنصلية السودانية', 'Sudanese Consulate', 500, 0, true, NULL, NULL, '[]'::jsonb, true, true, 0, '2025-12-11T18:55:39.699117+00:00', '2025-12-11T18:55:39.699117+00:00', NULL, NULL),
  ('98d7076d-45bf-4680-beca-eca1b9560b8a', 'معرض الثقافة والتراث السوداني', 'Sudanese Culture and Heritage Exhibition', 'معرض شامل يستعرض التراث والثقافة السودانية الأصيلة. يضم المعرض قطعاً أثرية، حرفاً يدوية تقليدية، أزياء شعبية، ولوحات فنية. كما يتضمن ورش عمل تفاعلية لتعليم الحرف اليدوية والفنون التقليدية.', 'Comprehensive exhibition showcasing authentic Sudanese heritage and culture. The exhibition features antiques, traditional handicrafts, folk costumes, and artistic paintings. It also includes interactive workshops to teach handicrafts and traditional arts.', 'معرض شامل يستعرض التراث والثقافة السودانية الأصيلة', 'Comprehensive exhibition showcasing authentic Sudanese heritage and culture', '2025-01-17', '16:00:00', NULL, NULL, 'صالة المعارض - القنصلية', 'Exhibition Hall - Consulate', NULL, NULL, 'tomorrow', 'https://images.pexels.com/photos/1181677/pexels-photo-1181677.jpeg?auto=compress&cs=tinysrgb&w=600', '[]'::jsonb, 'وزارة الثقافة', 'Ministry of Culture', 200, 0, false, NULL, NULL, '[]'::jsonb, false, true, 0, '2025-12-11T18:55:39.699117+00:00', '2025-12-11T18:55:39.699117+00:00', NULL, NULL),
  ('5aaf556e-edee-4f5f-995d-6e9a113c9c2b', 'ندوة حول الخدمات القنصلية الجديدة', 'Seminar on New Consular Services', 'ندوة تعريفية حول الخدمات القنصلية الجديدة والإجراءات المحدثة. سيتم شرح كافة الخدمات الإلكترونية المتاحة، كيفية استخدامها، والإجابة على أسئلة واستفسارات الحضور. الندوة موجهة لجميع أفراد الجالية السودانية.', 'Introductory seminar on new consular services and updated procedures. All available electronic services will be explained, how to use them, and answer questions from attendees. The seminar is directed to all members of the Sudanese community.', 'ندوة تعريفية حول الخدمات القنصلية الجديدة والإجراءات المحدثة', 'Introductory seminar on new consular services and updated procedures', '2025-01-17', '11:00:00', NULL, NULL, 'قاعة الاجتماعات - القنصلية', 'Meeting Hall - Consulate', NULL, NULL, 'tomorrow', 'https://images.pexels.com/photos/3184292/pexels-photo-3184292.jpeg?auto=compress&cs=tinysrgb&w=600', '[]'::jsonb, 'القنصلية السودانية', 'Sudanese Consulate', 120, 0, false, NULL, NULL, '[]'::jsonb, false, true, 0, '2025-12-11T18:55:39.699117+00:00', '2025-12-11T18:55:39.699117+00:00', NULL, NULL),
  ('56d1096b-b374-46ec-911a-705cbb519430', 'مؤتمر الاستثمار السوداني السعودي', 'Sudanese-Saudi Investment Conference', 'مؤتمر اقتصادي لتعزيز الاستثمارات المشتركة بين السودان والسعودية. يحضر المؤتمر وفود رسمية، رجال أعمال، ومستثمرون من البلدين. سيتم توقيع اتفاقيات تعاون في قطاعات الزراعة، الصناعة، التعدين، والطاقة المتجددة.', 'Economic conference to promote joint investments between Sudan and Saudi Arabia. The conference is attended by official delegations, businessmen, and investors from both countries. Cooperation agreements will be signed in agriculture, industry, mining, and renewable energy sectors.', 'مؤتمر اقتصادي لتعزيز الاستثمارات المشتركة بين السودان والسعودية', 'Economic conference to promote joint investments between Sudan and Saudi Arabia', '2025-01-18', '09:00:00', NULL, NULL, 'فندق الريتز كارلتون - جدة', 'Ritz Carlton Hotel - Jeddah', NULL, NULL, 'afterTomorrow', 'https://images.pexels.com/photos/3184339/pexels-photo-3184339.jpeg?auto=compress&cs=tinysrgb&w=600', '[]'::jsonb, 'وزارة الاستثمار', 'Ministry of Investment', 300, 0, true, NULL, NULL, '[]'::jsonb, true, true, 0, '2025-12-11T18:55:39.699117+00:00', '2025-12-11T18:55:39.699117+00:00', NULL, NULL),
  ('198a08d2-f5c3-4143-870a-4cbe406b0f92', 'أمسية شعرية سودانية', 'Sudanese Poetry Evening', 'أمسية شعرية تحتفي بالأدب والشعر السوداني الأصيل. يشارك في الأمسية نخبة من الشعراء السودانيين المقيمين في المملكة لإلقاء قصائدهم وأشعارهم. الأمسية مفتوحة لجميع محبي الأدب والشعر من الجالية السودانية والعربية.', 'Poetry evening celebrating authentic Sudanese literature and poetry. The evening features a selection of Sudanese poets residing in the Kingdom to recite their poems. The evening is open to all literature and poetry lovers from the Sudanese and Arab communities.', 'أمسية شعرية تحتفي بالأدب والشعر السوداني الأصيل', 'Poetry evening celebrating authentic Sudanese literature and poetry', '2025-01-18', '20:00:00', NULL, NULL, 'المركز الثقافي - جدة', 'Cultural Center - Jeddah', NULL, NULL, 'afterTomorrow', 'https://images.pexels.com/photos/1181406/pexels-photo-1181406.jpeg?auto=compress&cs=tinysrgb&w=600', '[]'::jsonb, 'اتحاد الأدباء السودانيين', 'Sudanese Writers Union', 150, 0, false, NULL, NULL, '[]'::jsonb, false, true, 0, '2025-12-11T18:55:39.699117+00:00', '2025-12-11T18:55:39.699117+00:00', NULL, NULL),
  ('d0dd552e-cc37-42d3-b05e-a100e7a824d2', 'ورشة عمل للحرف اليدوية السودانية', 'Sudanese Handicrafts Workshop', 'ورشة تعليمية للحرف اليدوية التقليدية السودانية. سيتم تعليم المشاركين صناعة المشغولات اليدوية التقليدية مثل السلال، الفخار، والمنسوجات. الورشة موجهة للمهتمين بالحفاظ على التراث وتعلم المهارات التقليدية.', 'Educational workshop on traditional Sudanese handicrafts. Participants will be taught how to make traditional handmade products such as baskets, pottery, and textiles. The workshop is aimed at those interested in preserving heritage and learning traditional skills.', 'ورشة تعليمية للحرف اليدوية التقليدية السودانية', 'Educational workshop on traditional Sudanese handicrafts', '2025-01-18', '15:00:00', NULL, NULL, 'مركز الفنون - القنصلية', 'Arts Center - Consulate', NULL, NULL, 'afterTomorrow', 'https://images.pexels.com/photos/1181677/pexels-photo-1181677.jpeg?auto=compress&cs=tinysrgb&w=600', '[]'::jsonb, 'جمعية الحرف اليدوية', 'Handicrafts Association', 50, 0, true, NULL, NULL, '[]'::jsonb, false, true, 0, '2025-12-11T18:55:39.699117+00:00', '2025-12-11T18:55:39.699117+00:00', NULL, NULL),
  ('69290d8b-dc8c-4a04-87b0-a33938052be3', 'لقاء رجال الأعمال السودانيين', 'Sudanese Businessmen Meeting', 'لقاء تجاري لتبادل الخبرات وتطوير الشراكات التجارية. يهدف اللقاء إلى تعزيز التعاون بين رجال الأعمال السودانيين في المملكة، مناقشة الفرص الاستثمارية، وتبادل الخبرات في مختلف المجالات التجارية والصناعية.', 'Business meeting to exchange experiences and develop commercial partnerships. The meeting aims to enhance cooperation among Sudanese businessmen in the Kingdom, discuss investment opportunities, and exchange experiences in various commercial and industrial fields.', 'لقاء تجاري لتبادل الخبرات وتطوير الشراكات التجارية', 'Business meeting to exchange experiences and develop commercial partnerships', '2025-01-23', '10:00:00', NULL, NULL, 'قاعة الأعمال - فندق الهيلتون', 'Business Hall - Hilton Hotel', NULL, NULL, 'nextWeek', 'https://images.pexels.com/photos/3184465/pexels-photo-3184465.jpeg?auto=compress&cs=tinysrgb&w=600', '[]'::jsonb, 'جمعية رجال الأعمال السودانيين', 'Sudanese Businessmen Association', 100, 0, true, NULL, NULL, '[]'::jsonb, false, true, 0, '2025-12-11T18:55:39.699117+00:00', '2025-12-11T18:55:39.699117+00:00', NULL, NULL),
  ('0ab3ba91-cf93-451b-97c2-dd71c37d1b6d', 'مهرجان الطعام السوداني', 'Sudanese Food Festival', 'مهرجان للتعريف بالمأكولات السودانية التقليدية والشعبية. يتضمن المهرجان أكشاك طعام تقدم أشهر الأطباق السودانية، عروض طبخ حية، ومسابقات طهي. المهرجان مفتوح للجميع من الجالية السودانية والسعودية.', 'Festival introducing traditional and popular Sudanese cuisine. The festival includes food stalls offering the most famous Sudanese dishes, live cooking shows, and cooking competitions. The festival is open to all from the Sudanese and Saudi communities.', 'مهرجان للتعريف بالمأكولات السودانية التقليدية والشعبية', 'Festival introducing traditional and popular Sudanese cuisine', '2025-01-24', '17:00:00', NULL, NULL, 'حديقة الأندلس - جدة', 'Al-Andalus Park - Jeddah', NULL, NULL, 'nextWeek', 'https://images.pexels.com/photos/1181263/pexels-photo-1181263.jpeg?auto=compress&cs=tinysrgb&w=600', '[]'::jsonb, 'القنصلية السودانية', 'Sudanese Consulate', 500, 0, false, NULL, NULL, '[]'::jsonb, true, true, 0, '2025-12-11T18:55:39.699117+00:00', '2025-12-11T18:55:39.699117+00:00', NULL, NULL),
  ('13f5fae2-c468-4520-8275-49554e0330e1', 'دورة اللغة العربية للأطفال', 'Arabic Language Course for Children', 'دورة تعليمية للأطفال السودانيين لتعزيز اللغة العربية. تستهدف الدورة الأطفال من سن 6 إلى 12 سنة وتركز على القراءة، الكتابة، والمحادثة باللغة العربية الفصحى. تستمر الدورة لمدة شهرين بواقع جلستين أسبوعياً.', 'Educational course for Sudanese children to enhance Arabic language skills. The course targets children aged 6 to 12 years and focuses on reading, writing, and speaking in classical Arabic. The course lasts for two months with two sessions per week.', 'دورة تعليمية للأطفال السودانيين لتعزيز اللغة العربية', 'Educational course for Sudanese children to enhance Arabic language skills', '2025-01-25', '16:00:00', NULL, NULL, 'قاعة التعليم - القنصلية', 'Education Hall - Consulate', NULL, NULL, 'nextWeek', 'https://images.pexels.com/photos/1181675/pexels-photo-1181675.jpeg?auto=compress&cs=tinysrgb&w=600', '[]'::jsonb, 'مركز تعليم اللغة العربية', 'Arabic Language Education Center', 40, 0, true, NULL, NULL, '[]'::jsonb, false, true, 0, '2025-12-11T18:55:39.699117+00:00', '2025-12-11T18:55:39.699117+00:00', NULL, NULL),
  ('5a83401f-5b62-4703-83ad-391ff49f0e7d', 'تست', 'تست', '', '', 'تست', 'تست', '2025-12-11', NULL, NULL, NULL, '', '', NULL, NULL, 'today', 'https://qaioxhpcyzmamcvdqqub.supabase.co/storage/v1/object/public/events-images/1765487836459-7kmom.png', '[]'::jsonb, '', '', NULL, 0, true, NULL, NULL, '[]'::jsonb, false, true, 0, '2025-12-11T21:17:31.607617+00:00', '2025-12-11T21:30:55.577145+00:00', 'ce268269-e837-4249-a931-54b9d9f7b38b', 'ce268269-e837-4249-a931-54b9d9f7b38b')
