INSERT INTO public.about_sudan_sections (id, section_key, title_ar, title_en, content_ar, content_en, image_url, icon, display_order, is_active, created_at, updated_at)
VALUES
  ('54be8678-7743-48d9-9bac-750589d275ae', 'food-security', 'سلة غذاء العالم', 'World''s Food Basket', 'يُعرف السودان بـ"سلة غذاء العالم" لما يمتلكه من أراضي زراعية خصبة تقدر بأكثر من 200 مليون فدان، ومياه وفيرة من النيل وروافده. ينتج السودان محاصيل استراتيجية مثل القمح والذرة والسمسم والفول السوداني والقطن، مما يجعله قادراً على إطعام مليار شخص.', 'Sudan is known as the "World''s Food Basket" with over 200 million acres of fertile agricultural land and abundant water from the Nile. Sudan produces strategic crops that can feed a billion people.', 'https://images.pexels.com/photos/2132227/pexels-photo-2132227.jpeg?auto=compress&cs=tinysrgb&w=1200', 'Wheat', 2, true, '2025-12-11T22:48:38.2238+00:00', '2025-12-11T22:48:38.2238+00:00'),
  ('a924955f-fef9-4c09-bcc9-6716d2b61eed', 'historical-depth', 'العمق التاريخي', 'Historical Depth', 'يمتد تاريخ السودان لأكثر من 5000 سنة، حيث قامت على أرضه حضارات عظيمة مثل مملكة كوش ومملكة مروي والممالك المسيحية النوبية. يضم السودان أكثر من 255 هرماً، أكثر من مصر، وآثاراً تشهد على عراقة هذه الأرض وحضارتها المتجذرة.', 'Sudan''s history spans over 5000 years, with great civilizations like the Kingdom of Kush and Meroe. Sudan has more than 255 pyramids, more than Egypt, testament to its ancient civilization.', 'https://images.pexels.com/photos/1181263/pexels-photo-1181263.jpeg?auto=compress&cs=tinysrgb&w=1200', 'Crown', 3, true, '2025-12-11T22:48:38.2238+00:00', '2025-12-11T22:48:38.2238+00:00'),
  ('55adfbfa-7777-40be-b6b3-13ddfe6d0806', 'tourism-potential', 'الإمكانات السياحية', 'Tourism Potential', 'يتمتع السودان بتنوع سياحي فريد يشمل السياحة الأثرية في مروي والبجراوية، والسياحة البحرية على ساحل البحر الأحمر، والسياحة البيئية في محميات الدندر وسنقنيب، والسياحة الثقافية التي تعكس تنوع الثقافات والتقاليد السودانية الأصيلة.', 'Sudan enjoys unique tourism diversity including archaeological tourism in Meroe, marine tourism on the Red Sea coast, eco-tourism in reserves, and cultural tourism reflecting diverse Sudanese traditions.', 'https://images.pexels.com/photos/1181675/pexels-photo-1181675.jpeg?auto=compress&cs=tinysrgb&w=1200', 'Camera', 4, true, '2025-12-11T22:48:38.2238+00:00', '2025-12-11T22:48:38.2238+00:00'),
  ('cd0ef8da-e44b-4d1b-8e73-d915b5413a7a', 'cultural-diversity', 'التنوع الثقافي', 'Cultural Diversity', 'السودان بلد التنوع الثقافي بامتياز، حيث تتعايش أكثر من 500 قبيلة و114 لغة في انسجام تام. هذا التنوع يظهر جلياً في الفنون والموسيقى والأزياء التقليدية والمطبخ السوداني الغني بالنكهات المتنوعة التي تمزج بين الأصالة العربية والإفريقية.', 'Sudan is a country of cultural diversity par excellence, with over 500 tribes and 114 languages coexisting in harmony. This diversity is evident in arts, music, traditional costumes, and Sudanese cuisine.', 'https://images.pexels.com/photos/2132227/pexels-photo-2132227.jpeg?auto=compress&cs=tinysrgb&w=1200', 'Palette', 5, true, '2025-12-11T22:48:38.2238+00:00', '2025-12-11T22:48:38.2238+00:00'),
  ('a271ebd9-3ce2-4d55-be45-81822ddaec91', 'natural-resources', 'الثروات الطبيعية', 'Natural Resources', 'يمتلك السودان ثروات طبيعية هائلة تشمل الذهب والنفط والمعادن النفيسة. ينتج السودان حوالي 75 طناً من الذهب سنوياً، بالإضافة إلى احتياطيات ضخمة من النحاس والحديد والكروم والمنغنيز. كما يمتلك ثروة حيوانية تقدر بأكثر من 100 مليون رأس.', 'Sudan possesses enormous natural resources including gold, oil, and precious minerals. Sudan produces about 75 tons of gold annually, plus huge reserves of copper, iron, chromium, and manganese.', 'https://images.pexels.com/photos/2132227/pexels-photo-2132227.jpeg?auto=compress&cs=tinysrgb&w=1200', 'Gem', 6, true, '2025-12-11T22:48:38.2238+00:00', '2025-12-11T22:48:38.2238+00:00'),
  ('e65558bf-75f4-4cf0-a249-fa4bbcaec687', 'strategic-location', 'الموقع الاستراتيجي', 'Strategic Location', 'يقع السودان في موقع استراتيجي فريد يربط بين قارتي أفريقيا وآسيا، ويطل على البحر الأحمر بساحل يمتد لأكثر من 853 كيلومتراً. هذا الموقع جعله جسراً حضارياً وتجارياً عبر التاريخ، ونقطة التقاء بين الثقافات العربية والأفريقية.', 'Sudan is located in a unique strategic position linking Africa and Asia, overlooking the Red Sea with a coastline extending over 853 kilometers. This location has made it a civilizational and commercial bridge throughout history.', 'https://images.pexels.com/photos/2132227/pexels-photo-2132227.jpeg?auto=compress&cs=tinysrgb&w=1200', 'Globe', 1, true, '2025-12-11T22:48:38.2238+00:00', '2025-12-11T22:57:33.811+00:00')
