INSERT INTO public.chatbot_questions_answers (id, category_id, question_ar, question_en, answer_ar, answer_en, keywords, priority, is_active, usage_count, helpful_count, not_helpful_count, created_by, created_at, updated_at)
VALUES
  ('6cda1d56-089a-4a35-a528-703c07f3b98d', 'e8b2d56e-0c45-4deb-8608-437fdf75b896', 'ما هي مواعيد عمل القنصلية؟', NULL, 'مواعيد عمل القنصلية من الأحد إلى الخميس من الساعة 9 صباحاً حتى 5 مساءً. نحن مغلقون أيام الجمعة والسبت والعطلات الرسمية.', NULL, '["مواعيد","عمل","دوام","ساعات"]'::jsonb, 10, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('a1fe89f9-1e21-4730-be1b-16f6d682b5c0', 'e8b2d56e-0c45-4deb-8608-437fdf75b896', 'كيف يمكنني التواصل مع القنصلية؟', NULL, 'يمكنك التواصل معنا عبر الهاتف، البريد الإلكتروني، أو من خلال نموذج الاتصال على موقعنا. كما يمكنك زيارتنا شخصياً خلال ساعات العمل الرسمية.', NULL, '["تواصل","اتصال","هاتف","بريد"]'::jsonb, 9, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('9eafacc4-ba52-4331-bc9e-0f19c9867e25', 'fc0a2efe-1779-4840-8475-188563a800cf', 'كيف أقدم طلب جواز سفر جديد؟', NULL, 'لتقديم طلب جواز سفر جديد: 1) قم بتسجيل الدخول إلى الموقع 2) اختر خدمة "جوازات السفر" 3) املأ النموذج بالبيانات المطلوبة 4) أرفق المستندات المطلوبة 5) ادفع الرسوم 6) احجز موعد لاستلام الجواز.', NULL, '["جواز","جواز سفر","إصدار","جديد"]'::jsonb, 10, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('c03e9214-b69f-4b2c-a9f6-a61ad6d80321', 'fc0a2efe-1779-4840-8475-188563a800cf', 'ما هي المستندات المطلوبة لتجديد الجواز؟', NULL, 'المستندات المطلوبة لتجديد الجواز: 1) صورة من الجواز القديم 2) صورة شخصية حديثة 3) صورة من الإقامة السارية 4) استمارة التجديد معبأة. يرجى التأكد من أن جميع المستندات واضحة ومقروءة.', NULL, '["تجديد","جواز","مستندات","وثائق"]'::jsonb, 10, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('1363fb33-258c-4880-b0b7-8774d559cec4', 'fc0a2efe-1779-4840-8475-188563a800cf', 'كم تستغرق مدة إصدار الجواز؟', NULL, 'مدة إصدار الجواز عادة من 7 إلى 14 يوم عمل بعد تقديم الطلب الكامل ودفع الرسوم. يمكنك تتبع حالة طلبك من خلال صفحة تتبع الطلبات باستخدام الرقم المرجعي.', NULL, '["مدة","كم يوم","استغرق","وقت"]'::jsonb, 9, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('08c20f26-0d23-40b3-8216-96d517eb21c2', 'fc0a2efe-1779-4840-8475-188563a800cf', 'ما هي رسوم إصدار الجواز؟', NULL, 'رسوم إصدار الجواز تختلف حسب نوع الجواز ومدة صلاحيته. يمكنك الاطلاع على قائمة الرسوم الكاملة عند اختيار الخدمة. الرسوم تدفع إلكترونياً عبر الموقع.', NULL, '["رسوم","تكلفة","سعر","مبلغ"]'::jsonb, 9, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('926eae6b-a8a5-4ade-8eef-38dfd2f10227', '8e9cefbd-fa99-4dc7-9419-6bdeb6b191ba', 'كيف أطلب تصديق شهادة تعليمية؟', NULL, 'لطلب تصديق شهادة تعليمية: 1) اختر خدمة "التصديقات" 2) حدد نوع الشهادة 3) أرفق صورة واضحة من الشهادة الأصلية 4) أرفق المستندات الداعمة 5) ادفع الرسوم. سنتواصل معك بعد مراجعة الطلب.', NULL, '["شهادة","تعليمية","تصديق","دراسية"]'::jsonb, 10, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('a8782b52-cfe7-4f0f-ab62-fe35764ce204', '8e9cefbd-fa99-4dc7-9419-6bdeb6b191ba', 'هل يمكن إرسال المستندات للتصديق بالبريد؟', NULL, 'نعم، يمكن إرسال المستندات للتصديق من خلال شركات الشحن المعتمدة. يرجى التأكد من تعبئة نموذج الطلب إلكترونياً أولاً والحصول على رقم مرجعي قبل إرسال المستندات.', NULL, '["بريد","شحن","إرسال","توصيل"]'::jsonb, 8, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('d1b13da8-7ff6-4d0b-a010-00313fcd4875', '146e7bcd-4bfa-4796-bd08-3d97a939b4c2', 'ما هي الوكالة وما استخداماتها؟', NULL, 'الوكالة هي مستند قانوني يخول شخصاً (الوكيل) بالتصرف نيابة عن شخص آخر (الموكل). تستخدم الوكالات في المعاملات العقارية، البنكية، التجارية، والإجراءات الحكومية.', NULL, '["وكالة","توكيل","ما هي"]'::jsonb, 9, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('f805761a-db28-41e2-a364-356b534bdb15', '146e7bcd-4bfa-4796-bd08-3d97a939b4c2', 'كيف أستخرج وكالة عامة؟', NULL, 'لاستخراج وكالة عامة: 1) اختر خدمة "الوكالات" 2) حدد نوع الوكالة (عامة) 3) املأ بيانات الموكل والوكيل 4) حدد صلاحيات الوكالة 5) احجز موعد لتوقيع الوكالة في القنصلية بحضور الموكل شخصياً.', NULL, '["وكالة عامة","استخراج","إصدار"]'::jsonb, 10, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('5552f6b4-59b8-4e4e-9d74-bd0dcca149e2', '146e7bcd-4bfa-4796-bd08-3d97a939b4c2', 'هل يجب حضور الموكل شخصياً؟', NULL, 'نعم، يجب حضور الموكل شخصياً إلى القنصلية لتوقيع الوكالة أمام الموظف المختص. يجب إحضار الجواز الأصلي والإقامة السارية.', NULL, '["حضور","شخصياً","موكل"]'::jsonb, 9, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('3d3e51ef-0fd1-4413-9a3f-7c1a717e80d5', 'a855da0e-78a4-445b-be41-3c9e663b7527', 'كيف أسجل أبنائي في الخدمات التعليمية؟', NULL, 'لتسجيل الأبناء في الخدمات التعليمية: 1) اختر "الخدمات التعليمية" 2) حدد نوع الخدمة (ابتدائي/متوسط/ثانوي) 3) املأ بيانات الطالب 4) أرفق المستندات المطلوبة 5) ادفع الرسوم. سيتم التواصل معك لتحديد موعد الامتحان إن لزم.', NULL, '["تعليم","مدرسة","أبناء","تسجيل"]'::jsonb, 10, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('7fdce39b-46ae-485d-a177-dae5de2db2af', 'e8b2d56e-0c45-4deb-8608-437fdf75b896', 'أين يقع مقر القنصلية؟', NULL, 'القنصلية العامة لجمهورية السودان في المملكة العربية السعودية. يمكنك العثور على العنوان الكامل ورقم الهاتف في صفحة اتصل بنا.', NULL, '["موقع","عنوان","مكان","أين"]'::jsonb, 10, true, 1, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-19T11:20:59.655328+00:00'),
  ('b59a0c28-b1a3-48a2-8727-c4ee3a7080f6', '8e9cefbd-fa99-4dc7-9419-6bdeb6b191ba', 'ما هي خدمة التصديقات؟', NULL, 'خدمة التصديقات هي عملية التحقق من صحة الوثائق والمستندات الرسمية وإضفاء الصفة الرسمية عليها. نقدم تصديقات على الشهادات التعليمية، العقود، الوثائق الشخصية، والمستندات التجارية.', NULL, '["تصديق","تصديقات","توثيق"]'::jsonb, 10, true, 1, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-19T11:24:57.066384+00:00'),
  ('ea2605b1-9dc3-4416-960c-16f9e9c71757', 'a855da0e-78a4-445b-be41-3c9e663b7527', 'ما هي المستندات المطلوبة للتسجيل التعليمي؟', NULL, 'المستندات المطلوبة: 1) شهادة الميلاد 2) جواز سفر الطالب 3) آخر شهادة دراسية 4) صورة من إقامة ولي الأمر 5) 4 صور شخصية للطالب. يجب أن تكون جميع المستندات مصدقة.', NULL, '["مستندات","وثائق","تعليم"]'::jsonb, 9, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('cd44f6c7-a095-4443-ad64-28acaa17327a', 'a7ee924f-e76c-49aa-94cc-57d2ab73b641', 'كيف أحجز موعد في القنصلية؟', NULL, 'لحجز موعد: 1) سجل دخولك إلى الموقع 2) اذهب إلى صفحة "المواعيد" 3) اختر الخدمة المطلوبة 4) اختر التاريخ والوقت المناسب 5) أكد الحجز. ستصلك رسالة تأكيد بالبريد الإلكتروني مع تفاصيل الموعد.', NULL, '["موعد","حجز","موعد قنصلية"]'::jsonb, 10, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('e5047b14-315b-4e3f-9307-141266f6ffb1', 'a7ee924f-e76c-49aa-94cc-57d2ab73b641', 'هل يمكن تعديل أو إلغاء الموعد؟', NULL, 'نعم، يمكنك تعديل أو إلغاء موعدك من خلال صفحة "مواعيدي" في حسابك. يرجى القيام بذلك قبل 24 ساعة على الأقل من موعدك المحدد.', NULL, '["تعديل","إلغاء","تغيير موعد"]'::jsonb, 9, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('2f5d38a2-0470-41e5-bc74-4b7863ef825a', 'a7ee924f-e76c-49aa-94cc-57d2ab73b641', 'ماذا أحضر معي للموعد؟', NULL, 'يرجى إحضار: 1) بطاقة الهوية أو الجواز الأصلي 2) الإقامة السارية 3) رقم الموعد المرسل لك 4) المستندات المطلوبة حسب نوع الخدمة. يرجى الحضور قبل 15 دقيقة من موعدك.', NULL, '["موعد","أحضر","ما أجيب"]'::jsonb, 9, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('0e73a12f-82a7-4702-8a2e-176641a6f907', '9cd967e9-0801-407c-bd4f-a8dd72b78ac9', 'كيف أتتبع طلبي؟', NULL, 'لتتبع طلبك: 1) اذهب إلى صفحة "تتبع الطلبات" 2) أدخل الرقم المرجعي لطلبك أو رقم الهاتف المسجل 3) اضغط على "تتبع". ستظهر لك حالة الطلب والمراحل التي مر بها.', NULL, '["تتبع","متابعة","حالة طلب","رقم مرجعي"]'::jsonb, 10, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('1a95304d-6071-4fae-96f2-d66339b6b2e3', '9cd967e9-0801-407c-bd4f-a8dd72b78ac9', 'ماذا يعني كل وضع من أوضاع الطلب؟', NULL, 'أوضاع الطلب: "قيد المراجعة" - يتم مراجعة طلبك، "معتمد" - تمت الموافقة، "قيد المعالجة" - جاري تجهيز المستندات، "جاهز للاستلام" - يمكنك استلام طلبك، "تم التسليم" - تم تسليم الطلب.', NULL, '["حالة","وضع","معنى","status"]'::jsonb, 8, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('604777fa-4586-45e4-bbe7-410e50ec0c2b', '9cd967e9-0801-407c-bd4f-a8dd72b78ac9', 'لم يتحرك طلبي منذ أيام، ماذا أفعل؟', NULL, 'إذا لم تتغير حالة طلبك لأكثر من 5 أيام عمل، يرجى التواصل معنا عبر: 1) الدردشة المباشرة 2) البريد الإلكتروني 3) الهاتف. احرص على ذكر الرقم المرجعي لطلبك.', NULL, '["طلب متأخر","لم يتحرك","تأخير"]'::jsonb, 9, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('46189156-4256-43de-9631-abd7fefb8c6b', 'a5e7db0c-5ced-49a0-acc9-2a72a310797c', 'ما هي طرق الدفع المتاحة؟', NULL, 'طرق الدفع المتاحة: 1) الدفع الإلكتروني (بطاقة ائتمان/مدى) 2) التحويل البنكي 3) الدفع نقداً في القنصلية (للمراجعين فقط). يفضل الدفع الإلكتروني لسرعة معالجة الطلب.', NULL, '["دفع","طرق دفع","payment","تحويل"]'::jsonb, 10, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('f2e5c7b2-8e4e-43ca-b61d-d2aa713b5819', 'a5e7db0c-5ced-49a0-acc9-2a72a310797c', 'هل يمكن استرداد الرسوم؟', NULL, 'يمكن استرداد الرسوم في حالات محددة: 1) رفض الطلب من القنصلية لأسباب إدارية 2) إلغاء الطلب قبل بدء المعالجة. لا يمكن الاسترداد بعد بدء معالجة الطلب. يتم الاسترداد خلال 7-14 يوم عمل.', NULL, '["استرداد","إرجاع","refund"]'::jsonb, 8, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('514cdb2d-e820-4fa7-872e-a5288bf58f3b', 'a5e7db0c-5ced-49a0-acc9-2a72a310797c', 'كيف أحصل على فاتورة لدفعي؟', NULL, 'بعد إتمام الدفع، ستحصل تلقائياً على فاتورة إلكترونية عبر البريد الإلكتروني. يمكنك أيضاً طباعتها من حسابك في قسم "طلباتي" > "عرض الفاتورة".', NULL, '["فاتورة","إيصال","invoice"]'::jsonb, 8, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('c9426e04-095c-4eda-9c30-ef6d108a1173', '45ea40e6-8f65-46f7-a693-03023b8e0cf6', 'لا أستطيع تسجيل الدخول، ما الحل؟', NULL, 'إذا واجهت مشكلة في تسجيل الدخول: 1) تأكد من إدخال رقم الهاتف بشكل صحيح (مثال: +966501234567) 2) تحقق من رمز OTP المرسل 3) جرب "نسيت كلمة المرور" 4) امسح ذاكرة المتصفح وحاول مجدداً. إذا استمرت المشكلة، تواصل مع الدعم الفني.', NULL, '["تسجيل دخول","login","دخول","مشكلة"]'::jsonb, 10, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('9450dfa5-ea6f-4c54-bfdc-965c00fab7b8', '45ea40e6-8f65-46f7-a693-03023b8e0cf6', 'لم يصلني رمز التحقق OTP؟', NULL, 'إذا لم يصلك رمز التحقق: 1) تأكد من إدخال رقم الهاتف بشكل صحيح 2) انتظر دقيقة واحدة ثم اطلب إعادة إرسال 3) تحقق من رسائل SMS المحظورة 4) جرب رقم هاتف آخر. إذا استمرت المشكلة، تواصل معنا.', NULL, '["OTP","رمز تحقق","لم يصل"]'::jsonb, 9, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('bfd519a6-e7e4-41e7-bccf-54ec9391851d', '45ea40e6-8f65-46f7-a693-03023b8e0cf6', 'كيف أرفع ملف أو مستند؟', NULL, 'لرفع ملف: 1) اضغط على زر "اختر ملف" أو "رفع مستند" 2) حدد الملف من جهازك (الحجم الأقصى 10 ميجابايت) 3) تأكد أن الملف بصيغة مدعومة (PDF, JPG, PNG) 4) انتظر حتى يكتمل التحميل. إذا فشل التحميل، جرب ملف أصغر أو صيغة مختلفة.', NULL, '["رفع ملف","upload","تحميل مستند"]'::jsonb, 8, true, 0, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-12T12:45:12.645945+00:00'),
  ('329d58b7-9a27-4f43-b8e7-1fe8a582884d', 'e8b2d56e-0c45-4deb-8608-437fdf75b896', 'ما هي الخدمات التي تقدمها القنصلية؟', NULL, 'نقدم خدمات متنوعة تشمل: إصدار وتجديد الجوازات، التصديقات، الوكالات، الخدمات التعليمية، خدمات الأحوال المدنية، وغيرها. يمكنك تصفح قائمة الخدمات الكاملة على موقعنا.', NULL, '["خدمات","ماذا تقدم","قائمة"]'::jsonb, 10, true, 1, 0, 0, NULL, '2025-12-12T12:45:12.645945+00:00', '2025-12-13T21:19:02.333059+00:00')
