معركة الكرامة ليست مجرد صراع عسكري، بل هي رمز لإرادة شعب يرفض الانكسار ويصر على حماية وحدته الوطنية وسيادته. إنها قصة صمود وبطولة تكتب بأحرف من نور في تاريخ السودان الحديث.', 'Since mid-2023, Sudan has faced critical challenges threatening the unity of its territories and the stability of its people. In these difficult times, the Sudanese people have shown exceptional resilience and unwavering determination in defending their dignity and homeland.

The Battle of Dignity is not merely a military conflict, but a symbol of the will of a people who refuse to be broken and insist on protecting their national unity and sovereignty. It is a story of resilience and heroism written in letters of light in modern Sudanese history.', 'https://images.pexels.com/photos/8111847/pexels-photo-8111847.jpeg', '{}'::jsonb, 1, true, '2025-12-18T11:41:47.903258+00:00', '2025-12-18T11:41:47.903258+00:00', NULL),
  ('a460af6d-7e37-4d21-886e-2b03cee6f100', 'karama-battle', 'unity', 'الوحدة الوطنية قوتنا', 'National Unity is Our Strength', 'في أحلك الظروف، أثبت الشعب السوداني أن الوحدة الوطنية هي السلاح الأقوى في مواجهة التحديات. تجاوزت هذه الوحدة كل الحدود الإقليمية والقبلية والسياسية، لتجسد روح السودان الواحد الموحد.

المواطنون من جميع أنحاء البلاد، من الشرق والغرب والشمال والجنوب، وقفوا صفاً واحداً في الدفاع عن الوطن. هذا التلاحم الوطني هو أعظم إنجاز حققه الشعب السوداني في هذه المحنة.

إن الحفاظ على هذه الوحدة والبناء عليها هو السبيل الوحيد لضمان مستقبل مشرق لأجيالنا القادمة.', 'In the darkest circumstances, the Sudanese people proved that national unity is the strongest weapon in facing challenges. This unity transcended all regional, tribal, and political boundaries, embodying the spirit of one unified Sudan.

Citizens from all parts of the country, from the east and west, north and south, stood as one in defending the homeland. This national cohesion is the greatest achievement made by the Sudanese people in this ordeal.

Maintaining and building upon this unity is the only way to ensure a bright future for our coming generations.', 'https://images.pexels.com/photos/3184325/pexels-photo-3184325.jpeg', '{}'::jsonb, 2, true, '2025-12-18T11:41:47.903258+00:00', '2025-12-18T11:41:47.903258+00:00', NULL),
  ('95e68b9e-06f5-4518-91fe-9b3216697f9b', 'karama-battle', 'courage', 'تضحيات الشعب السوداني', 'Sacrifices of the Sudanese People', 'قدم الشعب السوداني تضحيات جسيمة في سبيل الحفاظ على وحدة الوطن وكرامته. آلاف الأسر نزحت من ديارها، وملايين المواطنين تأثروا بالصراع، لكن روح المقاومة لم تنكسر.

رغم كل المعاناة، استمر المواطنون في تقديم الدعم لبعضهم البعض. تشكلت مبادرات شعبية لمساعدة النازحين، وأقيمت مراكز إيواء، ونظمت حملات إغاثة. هذه المبادرات تعكس أصالة الشعب السوداني وتراحمه.

إن هذه التضحيات لن تذهب سدى، بل ستبقى نبراساً يضيء طريق الأجيال القادمة نحو سودان أقوى وأكثر تماسكاً.', 'The Sudanese people have made immense sacrifices to preserve the unity and dignity of the homeland. Thousands of families were displaced from their homes, and millions of citizens were affected by the conflict, but the spirit of resistance was not broken.

Despite all the suffering, citizens continued to support each other. Popular initiatives were formed to help the displaced, shelters were established, and relief campaigns were organized. These initiatives reflect the authenticity and compassion of the Sudanese people.

These sacrifices will not be in vain, but will remain a beacon lighting the way for future generations towards a stronger and more cohesive Sudan.', 'https://images.pexels.com/photos/6646914/pexels-photo-6646914.jpeg', '{}'::jsonb, 3, true, '2025-12-18T11:41:47.903258+00:00', '2025-12-18T11:41:47.903258+00:00', NULL),
  ('2c61f03c-4937-489e-adca-26bfb76c4818', 'karama-battle', 'future', 'نحو مستقبل أفضل', 'Towards a Better Future', 'رغم التحديات الراهنة، يبقى الأمل في مستقبل أفضل للسودان حياً في قلوب شعبه. الدروس المستفادة من هذه المحنة ستكون أساساً لبناء سودان أقوى وأكثر استقراراً.

الطريق نحو المستقبل يتطلب:
• الحفاظ على الوحدة الوطنية وتعزيزها
• إعادة بناء ما تهدم بروح من التعاون والتكاتف
• الاستثمار في التعليم والصحة والبنية التحتية
• تعزيز قيم التسامح والعدالة والمساواة
• حماية حقوق جميع المواطنين دون تمييز

معاً، بإرادتنا وعزيمتنا، سنبني السودان الذي نحلم به - سودان الأمن والسلام والازدهار.', 'Despite current challenges, hope for a better future for Sudan remains alive in the hearts of its people. The lessons learned from this ordeal will be the foundation for building a stronger and more stable Sudan.

The path to the future requires:
• Maintaining and strengthening national unity
• Rebuilding what was destroyed with a spirit of cooperation and solidarity
• Investing in education, health, and infrastructure
• Promoting values of tolerance, justice, and equality
• Protecting the rights of all citizens without discrimination

Together, with our will and determination, we will build the Sudan we dream of - a Sudan of security, peace, and prosperity.', 'https://images.pexels.com/photos/3184430/pexels-photo-3184430.jpeg', '{}'::jsonb, 4, true, '2025-12-18T11:41:47.903258+00:00', '2025-12-18T11:41:47.903258+00:00', NULL)
