• French (Good)', '2022-01-15', NULL, true, 1, true, '2025-12-18T08:55:39.203778+00:00', '2025-12-18T08:55:39.203778+00:00', NULL, NULL),
  ('1bac7bb4-157c-4826-b30e-fdcedf70b841', 'السفير عبد الرحمن علي حسن', 'Ambassador Abdulrahman Ali Hassan', NULL, 'السفير عبد الرحمن علي حسن شغل منصب القنصل العام لجمهورية السودان في جدة خلال الفترة من 2018 إلى 2021.

قام خلال فترة عمله بتحديث العديد من الإجراءات القنصلية وتطوير خدمات الجالية السودانية. كان له دور بارز في تعزيز العلاقات الثنائية بين السودان والمملكة العربية السعودية.

من إنجازاته:
• تحسين أوقات إنجاز المعاملات
• افتتاح مكاتب استقبال جديدة
• تطوير نظام المواعيد
• تعزيز التواصل مع الجالية', 'Ambassador Abdulrahman Ali Hassan served as Consul General of the Republic of Sudan in Jeddah from 2018 to 2021.

During his tenure, he updated many consular procedures and developed services for the Sudanese community. He played a prominent role in strengthening bilateral relations between Sudan and the Kingdom of Saudi Arabia.

His achievements include:
• Improving transaction completion times
• Opening new reception offices
• Developing the appointment system
• Enhancing communication with the community', '2018-03-01', '2021-12-31', false, 2, true, '2025-12-18T08:55:39.203778+00:00', '2025-12-18T08:55:39.203778+00:00', NULL, NULL),
  ('a094405d-114c-4ef0-b8e1-baed98657733', 'السفير خالد محمد إبراهيم', 'Ambassador Khaled Mohamed Ibrahim', NULL, 'السفير خالد محمد إبراهيم خدم كقنصل عام لجمهورية السودان في جدة من 2015 إلى 2018.

تميزت فترة عمله بالاهتمام بالشؤون الاجتماعية للجالية والعمل على حل المشكلات والقضايا التي تواجه المواطنين السودانيين في المملكة.

من مساهماته:
• إنشاء قاعدة بيانات للجالية
• تطوير الخدمات الاجتماعية
• تعزيز التعاون مع السلطات السعودية', 'Ambassador Khaled Mohamed Ibrahim served as Consul General of the Republic of Sudan in Jeddah from 2015 to 2018.

His tenure was characterized by attention to the social affairs of the community and working to solve problems and issues facing Sudanese citizens in the Kingdom.

His contributions include:
• Creating a community database
• Developing social services
• Strengthening cooperation with Saudi authorities', '2015-06-01', '2018-02-28', false, 3, true, '2025-12-18T08:55:39.203778+00:00', '2025-12-18T08:55:39.203778+00:00', NULL, NULL)
