  ('0ff61c6f-2e50-47a4-8d03-6c0a14028eb7', 'اختيار الخدمة المطلوبة', 'Selecting the Required Service', 'بعد تسجيل الدخول، يمكنك اختيار الخدمة القنصلية المطلوبة:

