- خدمات الأحوال المدنية
- الخدمات التعليمية
- وغيرها
3. اضغط على الخدمة المطلوبة
4. اقرأ الشروط والمتطلبات بعناية
5. اضغط على "تقديم طلب"

نصيحة:
راجع قائمة المستندات المطلوبة قبل البدء في تعبئة الطلب لتجهيزها مسبقاً.', 'After logging in, you can select the required consular service:

